import React from 'react';
import Main from './Main'
import './App.scss';
import NavHeader from './NavHeader';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavHeader />
        <Main />
      </header>
      <footer>
        <span>Netflix inspired theme by <strong><a href="mailto:shagufta.mubasher01@gmail.com">Shagufta Mubasher</a></strong></span>
      </footer>
    </div>
  );
}

export default App;
